('2365','18','7890','Villa Gesellmann',Null,'Meerblick Villa in Nova Santa Ponsa zu verkaufen','33297','Diese mediterrane Villa wurde 1999 mit hochwertigen Materialien erstellt. Sie steht auf einem ca 1.650m² großen Grundstück in leichter Hanglage mit westlicher Ausrichtung. Die ca 285m² Wohnfläche verteilt sich auf 2 Etagen. Die sehr gepflegte Villa bietet ein helles Wohn-Esszimmer mit Panorama Fenstern, eine schicke neue Einbauküche, Hauswirtschaftsraum, 5 Schlafzimmer und 4 Badezimmer sowie ein Weinkeller. Im mediterran angelegten Garten befindet sich ein Pool umgeben von Liegeterrassen. Zur Ausstattung gehören u-a- eine Klimaanlage w/k, Kamin und Doppelglas Holzfenster','33298','1990000','106','2015-08-19 15:08:38','106','2015-08-19 15:09:26',Null,'2450','121','1150',1,'1','0',Null,Null,Null,'33299',Null,'0','0','0',Null,'2015-08-19 15:11:19',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33300',Null,'33301',Null,'33302',Null,'33303','00491728459665','33304','0',0,'4');
